const INITIAL_STATE = {
    sections: [
        {
            title: "modern",
            imageUrl: "https://ibb.co/2Mj3rCL.jpg",
            id: 1,
            linkUrl: "shop/modern",
        },
        {
            title: "classic",
            imageUrl: "https://i.ibb.co/tBQSS2H/Minimalist.jpg",
            id: 2,
            linkUrl: "shop/classic",
        },
        {
            title: "coastal",
            imageUrl: "https://i.ibb.co/rZtrtqW/craft-mortat.jpg",
            id: 3,
            size: "large",
            linkUrl: "shop/coastal",
        },
        {
            title: "minimal",
            imageUrl: "https://i.ibb.co/HtGP5h4/Colorfull.jpg",
            size: "large",
            id: 4,
            linkUrl: "shop/minimal",
        },

    ],
};

const directoryReducer = (state = INITIAL_STATE, action) => {
    switch (action.type) {
        default:
            return state;
    }
}

export default directoryReducer;
